import React from "react";

const Item = ( props ) =>{

    const { data } = props

    return(
        <div className="list-item">
            {/* <img src = {data.img} alt=""/> */}
            <div className="mask">
                <div className="left">
                    <p>{data.title}</p>
                    <p>{data.housetype}</p>
                </div>
                <div className="right">
                    <div className="btn">
                        {data.renttype}
                    </div>
                    <p>
                        {data.price}
                    </p>
                </div>
            </div>
        </div>
    )
}

export default Item
